import '../../../utils/generalMethods/general_methods.dart';

class RegisterViewModel extends BaseNotifier {
  TextEditingController nameController = TextEditingController();
  TextEditingController phoneController = TextEditingController();
  TextEditingController parentPhoneController = TextEditingController();
  TextEditingController emailController = TextEditingController();
  TextEditingController passwordController = TextEditingController();
  TextEditingController confirmPasswordController = TextEditingController();

  void register({required BuildContext context}) async {
    Map<String, dynamic> body =   {
      "fullName": nameController.text,
      "email": emailController.text,
      "phoneNumber": phoneController.text,
      "parentPhoneNumber": parentPhoneController.text,
      "password": passwordController.text,
      "confirmPassword": passwordController.text,
      "img": defImage,
    };
    setBusy();
    try {
      Response<dynamic> res = await api.register(body: body);
      if (res.data['errorCode'] == 0) {
        AppConstants.token = res.data['data']['token'];
        final String userName = res.data['data']['fullName'];
        CacheHelper.SaveData(key: PrefKeys.TOKEN, value: AppConstants.token);
        General.showToast(message: res.data['errorMessage']);
        Navigator.pushReplacement(
            context, SlideTransition1(ChooseClassScreen(userName)));
      }
      else
      {
        General.showToast(message: res.data['errorMessage']);

        General.showToast2(message: res.data['data']['message'].toString(),context: context);
    //    General.showToast(message: res.data['data']['message'].toString());
      }
    } catch (e) {
      Logger().e(e.toString());
      setError();
    }
    setIdle();
  }

  bool obscure = false;
  changeObscureText()
  {
    obscure = !obscure;
    notifyListeners();
  }

  String defImage =
      "data:image/jpeg;base64,";
}